import React from "react";
import { useAuth } from "../user/AuthUserContext";


const HomeLogged=()=>{
    const { user } = useAuth();
    return(

        <div className="container-fluid">
            <div className="row">
                <div className="col"><h1>Bienvenido</h1>
                {user.email}


                </div>

            </div>
        </div>

    )
}


export default HomeLogged
